import images from "../../../../images";
import pngimg from "../../../../images/test2.png"

const img = "https://images3.content-hci.com/commimg/myhotcourses/blog/post/myhc_94121.jpg"

const Content = () => {
  return (
    <>
      <div className="h-56 bg-red-800 from-cyan-500 to-blue-500 rounded-xl my-12">
        <img src={pngimg} alt="" />
        
      </div>
    </>
  );
};

export default Content;
